import React from 'react';
import Cotacoes from './Cotacoes';
import PrePage from './PrePage';

const MinhasCotacoes = () => {
    return(
        <>
        <PrePage children={
            <>
            <div>
                <div style={{
                }}>
                    <button onClick={() => alert('Novas')} className={"p-2"} style={{fontWeight: 'lighter', backgroundColor: 'beige', border: 0, borderRadius: 14}}>Novas</button>
                    <button onClick={() => alert('Não respondidas')} className={"p-2"} style={{fontWeight: 'lighter', backgroundColor: 'transparent', border: 0}}>Respondidas</button>
                    <button onClick={() => alert('Não respondidas')} className={"p-2"} style={{fontWeight: 'lighter', backgroundColor: 'transparent', border: 0}}>Não respondidas</button>
                </div>
            </div>
            <Cotacoes/>
            </>
        }/>
        </>
    )
}

export default MinhasCotacoes;
